DO BEGIN
	DECLARE i INT;
	DECLARE lines INT;
	DECLARE la_dates DATE ARRAY;
	DECLARE lv_date DATE := current_date;
	DECLARE counter INT;

	SELECT count(*)
		INTO lines
		FROM tasks;
	counter = :lines;
	lines = lines;
	FOR i IN 1..:lines DO
		lv_date = add_days(
				:lv_date, 
				uminus(round( rand() * 4,  0 ))
			);
		la_dates[:counter] = :lv_date;
		counter = :counter - 1;
	END FOR;
	lt_dates = unnest(:la_dates) WITH ORDINALITY AS (DATUM, id);
	UPDATE tasks
SET create_date = datum
FROM :lt_dates AS dates,
		tasks
WHERE tasks.id = dates.id;
END;
